window.bookSummaryJSON = "<p>A beloved legend of all time, Pyle's <i>The Merry Adventures of Robin Hood</i> tells the compelling tale of the brave, good-humored outlaw and his cohorts Friar Tuck, Little John, and Will Scarlet, as they cavort about Sherwood Forest.</p> <p>However, it is not all sport. Robin Hood and his band must also outwit the villainous Sheriff of Nottingham, who will stop at nothing to rid the forest of the outlaw.</p>"; 
